#[cfg(test)]
pub mod tests{


use std::ffi::CString;




use super::*;

#[test]
pub fn ScdPreprocessingValidatorPlugin_Test()
{
let diagnostics=TestJSON();
let mut searchRequest = TestSearchRequestjson();
let mut ScdPreprocessingValidatorPlugin: ScdPreprocessingValidatorPlugin=ScdPreprocessingValidatorPlugin::new();
let diagnostcs: Diagnostics=ScdPreprocessingValidatorPlugin.Execute(diagnostics,& mut searchRequest);
let messafes=serde_json::to_string(&diagnostcs).unwrap();
let rt=CString::new(messafes).unwrap().into_raw();
assert_eq!(diagnostcs.Events.len(),1);
}
}



pub fn TestSearchRequestjson() -> SearchRequest
{

  let dummy=r#"{  "EntityRequestContainers": [    {      "EntityRequest": {
    "FlexibleSchemaSettings":{"test":{"CandidatePropertySettings":{"valid":[{"Name":"Hello"}]},"AllSearchableProperties":[]},"test2":{"CandidatePropertySettings":{"valid":[{"Name":"Hello"}]},"AllSearchableProperties":[]}},
     "EntityType": "External","VerticalSettings":[{"DisplayName":"Wiki","EnableFanout":true,"ConnectionIds":["test"]}]  }}]}"#;
    let searchRequest: SearchRequest = serde_json::from_str(dummy).unwrap();
    searchRequest
}


